import React, { useState } from "react";

const StaffSalary = function () {
  const [staffData, setStaffData] = useState([
    {
      name: "OB1CHAM",
      rank: "Модератор",
      mainSalary: 150,
      asnwerForum: 3,
      online: 75600,
      additionallyOnline: 7200,
      bonus: 200,
      totalWeek: 455,
      totalAllTime: 10,
      birthday: "3 сентября",
    },
  ]);
  return (
    <div>
      {staffData.map((player) => {
        return <h1>player['name']</h1>;
      })}
      <h1>Зпшка</h1>
    </div>
  );
};

export default StaffSalary;
